import React from 'react';
import './midsection.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import IntroCard from './Introcard';
import inorganic from './inorganic web.jpg';
import organic from './organic web2.jpg';
import agro from './agro website.webp'

export default function Midsection() {

  const InfoCard = ({ image, title, description }) => {
    return (
      <div className="info-card">
        <div className="info-card-image" style={{ backgroundImage: `url(${image})` }}>
          <div className="info-card-content">
            <h3 className="info-card-title">{title}</h3>
            <p className="info-card-description">{description}</p>
          </div>
        </div>
      </div>
    );
  };

  return (
    <div>
      <div className="business-section container-fluid mb-1">
        <div className="text-center my-4">
          <h2 className="business-title">SHREEJI INTERNATIONAL</h2>
          <h3 className="business-subtitle">IMPORT | EXPORT </h3>
        </div>
      </div>

      <IntroCard></IntroCard> {/* introcard to show why Shreeji and all */}

      <div className="service-section container-fluid mb-0 text-center">
        <div className="my-4">
          <h2 className="service-title">OUR SERVICE</h2>
          <h4 className="service-subtitle">Our wide range of agrochemical services include:</h4>
        </div>

        <ul className="service-description mx-auto">
          <li>Advice and information on when and where to use our pesticides products.</li>
          <li>
            Products for hobby farmers through to agricultural operations - all in
            <span className="nowrap"> simple convenient packaging.</span>
          </li>
          <li>Specialist products supporting a diverse range of crops including:

            <li>broadcast-horticulture-viticulture-cotton-pasture-seed supply</li>

          </li>
        </ul>
      </div>

      <div className="service-cards d-flex justify-content-around flex-wrap">
        <InfoCard
          image={agro}
          title="Agrochemicals"
          description="We are Supply and export all agrochemicals with superior quality and best packaging materials. Our company is Dealing in S to H(seed to harvest) all chemical."
        />
        <InfoCard
          image={inorganic}
          title="Inorganic"
          description="Our company is Treading and export of best range of inorganic chemicals use for all Industrial chemical. We are providing best door to door services."
        />
        <InfoCard
          image={organic}
          title="Organic"
          description="Shreeji International Company supplies and exports Organic Chemicals manufactured by best quality and experienced scientific team."
        />
        {/* Add more InfoCard components as needed */}
      </div>
    </div>
  );
}
